import React from "react";

const UserAccount = () => {
	const token = localStorage.getItem("token");

	return (
		<div>
			<h1>Welcome to Your Account</h1>
			<p>Your token: {token}</p>
			{/* You can use the token to fetch and display user-specific data */}
		</div>
	);
};

export default UserAccount;
